function sumFibs(num) {
  if(num <= 1)
    return 1;
  let sum = 0;
  let curr = 1;
  let prev = 0;
  let temp = 0;
  while(curr <= num) {
    console.log(curr)
    if((curr % 2) === 1)
      sum += curr;
    temp = curr;
    curr += prev;
    prev = temp;
  }
  return sum;
}

